  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Browns
  Park National Wildlife Refuge outlines Refuge accomplishments during the 1965 calendar
  year. The report begins with a brief history of the Browns Park Valley, a forward,
  a summary of the weather conditions, habitat conditions, water conditions, and food
  and cover conditions during the year. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, mammals, and raptors-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, and safety. N-R
  forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
